// ==UserScript==
// @name         AWBW Turn warning
// @namespace    https://awbw.amarriner.com/
// @version      1.01
// @description  Adds audio and visual feedback to the tab when your turn starts.
// @author       Truniht
// @match        https://awbw.amarriner.com/game.php?games_id=*
// @icon         https://awbw.amarriner.com/favicon.ico
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/486380/AWBW%20Turn%20warning.user.js
// @updateURL https://update.greasyfork.org/scripts/486380/AWBW%20Turn%20warning.meta.js
// ==/UserScript==

(function() {
    /** SETTINGS */
    var volume = 100; //0-100
    var alwaysPlayTurnStart = true; //true or false, if true, will play the turn start notification even while in focus
    /** SETTINGS END */



    var lastTurn = 0;
    var turnSound = new Audio("data:audio/mpeg;base64,");
    var activeAlert = "";
    var lastAlertSound = 0;
    function init() {
        lastTurn = currentTurn;
        //Only do anything if the user is part of the game, start the interval that checks the time
        if (playersInfo[viewerPId]) {
            setInterval(checkTurn, 50);
            setInterval(activeAlertFlash, 250);
        }
    }

    function changeFavicon(src) {
        var link = document.createElement('link'),
        oldLink = document.getElementById('dynamic-favicon');
        link.id = 'dynamic-favicon';
        link.rel = 'shortcut icon';
        link.href = src;
        if (oldLink) document.head.removeChild(oldLink);
        document.head.appendChild(link);
    }

    function checkTurn() {
        if (currentTurn == lastTurn) return;
        lastTurn = currentTurn; //Update the state
        if (currentTurn == viewerPId) {
            if (alwaysPlayTurnStart) playAlertSound();
            showAlert();
        }
        else removeAlert();
    }

    var flashing = false;
    function activeAlertFlash() {
        if (!activeAlert) return;
        if (flashing) {
            changeFavicon('https://awbw.amarriner.com/favicon.ico');
            document.title = '!!!YOUR TURN!!! ' + activeAlert;
        }
        else {
            changeFavicon('data:image/png;base64,');
            document.title = 'YOUR TURN ' + activeAlert;
        }
        flashing = !flashing;
        playAlertSound();
    }

    function playAlertSound() {
        if (performance.now() - lastAlertSound < 5000) return;
        if (document.querySelector('.replay-controls').style.display !== 'none') return;
        lastAlertSound = performance.now();
        try {
            turnSound.volume = 0.5 * (volume / 100);
            turnSound.play();
        }
        catch(e) {}
    }

    function showAlert() {
        if (document.hasFocus()) return; //Only when not focused
        if (activeAlert) return;
        playAlertSound();
        activeAlert = document.title;
        activeAlertFlash();
        window.focus();
    }

    function removeAlert() {
        if (!activeAlert) return;
        document.title = activeAlert;
        activeAlert = "";
        changeFavicon('https://awbw.amarriner.com/favicon.ico');
        flashing = false;
    }

    window.addEventListener('focus', removeAlert);
    window.addEventListener('mousemove', removeAlert);
    window.addEventListener('load', init);
})();